},
{
  imageSrc: product4Image,
  productName: '마이 다이어트',
  rating: '4.27',
  reviewCount: 98,
  hashtags: ['#가르시니아', '#체지방 감소'],
  price: '25,000',
},
{
  imageSrc: product5Image,
  productName: '슬림큐브 플러스',
  rating: '4.36',
  reviewCount: 95,
  hashtags: ['#카테킨', '#배변활동원활'],
  price: '78,000',
},
{
  imageSrc: product6Image,
  productName: '시네트롤 브이세븐',
  rating: '3.71',
  reviewCount: 25,
  hashtags: ['#비타민B', '#건강기능식품'],
  price: '31,590',
},
{
  imageSrc: product7Image,
  productName: '올 뉴 초록이 시즌4',
  rating: '4.20',
  reviewCount: 39,
  hashtags: ['#미네랄', '#체지방감소'],
  price: '44,000',
},
{
  imageSrc: product8Image,
  productName: '슬림컷',
  rating: '4.20',
  reviewCount: 49,
  hashtags: ['#건강기능식품', '#서플리먼트'],
  price: '50,000',
},
{
  imageSrc: product9Image,
  productName: '세리컷 스타터 블루밍',
  rating: '4.20',
  reviewCount: 49,
  hashtags: ['#건강기능식품', '#카테킨'],
  price: '43,000',
},
{
  imageSrc: product9Image,
  productName: '세리컷 스타터 블루밍',
  rating: '4.20',
  reviewCount: 49,
  hashtags: ['#건강기능식품', '#카테킨'],
  price: '43,000',
},
{
  imageSrc: product9Image,
  productName: '세리컷 스타터 블루밍',
  rating: '4.20',
  reviewCount: 49,
  hashtags: ['#건강기능식품', '#카테킨'],
  price: '43,000',
},
];

function Search() {
  const totalPages = 10; // Replace 10 with your actual total number of pages
  const [currentPage, setCurrentPage] = React.useState(1);

  const onPageChange = (newPage) => {
    setCurrentPage(newPage);
    // Handle other logic, like fetching data for the new page
  };
  return (
    <div className="container">
      <div className="search-container">
        <form>
          <div className="search-section">
            <input
              type="text"
              id="search"
              className="input"
              placeholder="원하는 다이어트 보조제를 검색해보세요."
              required
            />

            <button type="submit" className="button">
              Search
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

function Main() {
  return (
    <div>
      <div className="main-container">
        <Navbar />
        <Search />
      </div>
      <div className="data-container">
        <div className="filter-container">
          <div className="filter-btn">
            <p>리뷰 많은 순</p>
          </div>
          <div className="filter-btn">
            <p>높은 평점 순</p>
          </div>
          <div className="filter-btn">
            <p>낮은 가격 순</p>
          </div>
        </div>
        <div className="price-container">
          <div className="price-btn">
            <div className="price-btn1">
              <p>2만 5천원 이하</p>
            </div>
            <div className="section">
              <p>ㅣ</p>
            </div>
            <div className="price-btn2">
              <p>2만 5천원~5만원</p>
            </div>
            <div className="section">
              <p>ㅣ</p>
            </div>
            <div className="price-btn3">
              <p>5만원 이상</p>
            </div>
          </div>
        </div>
        <div className="card-grid-container">
          {productDataList.map((productData, index) => (
            <SearchCard key={index} productData={productData} />
          ))}
        </div>
      </div>
      <div className="pagination-container">
      <PaginationRounded
            totalPages={totalPages}
            currentPage={currentPage}
            onPageChange={onPageChange}
          />
      </div>
      <div className="footer-container">
        <Footer />
      </div>
    </div>
  );
}

export default Main;
